import { Card, CardTitle, CardText } from "reactstrap"

export const Dragons = ({ dragon }: { dragon: any }) => {
  return (
    <div key={dragon.id}>
      <Card>
        <CardTitle>
          <p>{dragon.name}</p>
        </CardTitle>
        <CardText>
          <p>Description:</p>
          <p>{dragon.description}</p>
          <p>Crew Capacity: {dragon.crew_capacity} kg</p>
          <p>First Flight: {dragon.first_flight}</p>
        </CardText>

      </Card>
    </div>
  );
};
